import React from 'react';
import picture from '../../images/pricing/desktop/hero.jpg';

const PricingHeader = () => {
    return (
        <div className="pricing__header">
            <div className="pricing__header__textbox">
                <h1 className="pricing__header__textbox--heading">
                    Pricing
                </h1>
                <p className="pricing__header__textbox--subheading">
                    Create a your stories, Photosnap is a platform for photographers and visual storytellers. Itâ€™s the simple way to create and share your photos.
                </p>
            </div>
            <div className="pricing__header__image__container">
                <img 
                    className="pricing__header__image__container--image"
                    src={picture}
                    alt="Professional camera in hand for photography"
                />
            </div>
        </div>

    )
}

export default PricingHeader;
